import './App.css';

import { useApi } from './hooks/use-api';
import {useState} from 'react';



function Hey(){
  let rgbObj={o:0,tw:0,th:0};
  const [count, setCount] = useState(0);
  const [active, setActive] = useState(false);
  const [color, setColor] = useState({o:0,tw:0,th:0});

  function handleClick(){
    setCount(count+1);
    setActive(!active);
    setColor({o:Math.random(),tw:Math.random(),th:Math.random})    
  }
  return(
    <button className='heyButton' onClick={handleClick}
    style={{  
      backgroundColor: active ? "white" : "rgb("+color.o+","+color.tw+","+color.th+")"
    }}

    >
      This it + {count} + {color.o} + {color.tw} + {color.th}
    </button>
   );
  }


function App() {
  const { response } = useApi();

  return (
    <div className="App">
      <header className="App-header">
        <Hey/>
        <p>
          {response}
        </p>
      </header>
    </div>
  );
}

export default App;
